const CustomDropdownToggle = React.forwardRef(({ children, onClick }, ref) => (
  <span ref={ref} onClick={e => {
    e.preventDefault();
    onClick(e);
  }}>
    {children}
  </span>
));

export default CustomDropdownToggle;
